  \"2013-03-16T00:13:43.805202\",\n\t\"name\": \"interpretation-of-the-dipole-dipole-electrical-resistivity-survey-tuscarora-geothermal-area-elk\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Interpretation of Tuscarora geothermal
  area model results has suggested that low resistivity zones on two dipole-dipole
  lines (9 and 16) and possibly on a third (line 5) are related to thermal fluids.
  These two-dimensional models have delineated what appear to be aquifers within the
  valley sediments and the Tertiary volcanics. Structural breaks noted at the surface
  by geologic mapping are also evident i n the interpretive models.n  The area southeast
  of the hot springs in Hot Creek is poorly delineated by the current dipole-dipole
  coverage, yet this appears to be the most promising prospect area based upon the
  available data coverage. Exploratory drilling is currently moving in this direction.
  Perhaps additional dipole-dipole lines could aid in the selection of future drill
  sites.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
